import React from "react";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";

import arcade from "../images/arcade.png";
import calcetto from "../images/calcetto.png";
import coding from "../images/coding.png";
import furnace from "./images/furnace.png";
import grill from "../images/grill.png";
import party from "../images/party.png";
import meeting from "../images/meeting.png";
import pingpong from "../images/pingpong.png";

const Cards = (props) => {
    const arrayImages = [
        {id:'1', img:{arcade}, content:"Arcade"},
        {id:'2', img:{calcetto}, content:"Table Soccer"},
        {id:'3', img:{coding}, content:"Coding"},
        {id:'4', img:{furnace}, content:"Furnace"},
        {id:'5', img:{grill}, content:"Grill"},
        {id:'6', img:{party}, content:"Party"},
        {id:'7', img:{meeting}, content:"Meeting"},
        {id:'8', img:{pingpong}, content:"Ping Pong"},
    ]

    return ( 
        <> 
        {arrayImages.map(immagine => (
        <Card key={immagine.id}>{immagine.img}
            <CardContent>{immagine.content}.</CardContent>
        </Card>   
        ))}
        </>
     );
}
 
export default Cards;
